import React from 'react';
import Header from './components/Header';

function MyApp(){
    return(
    <div>
        <Header/>
        <h1>JavaScript Web Frameworks</h1>
        <ul>
            <li>React</li>
            <li>Angular</li>
            <li>Vjue.js</li>
            <h1>This was done through modular components</h1>
            
        </ul>
    </div>
    );
}

export default MyApp;
